    e.preventDefault()
    console.log(email);
  }
  return (
    <>
    <form onSubmit={handleSubmit}>
      <label htmlfor="email">email</label>
      <input
        value={email}
        type="email"
        placeholder="mokhtar@gmail.com"
        id="email"
        name="email"
       />
